measurements.description:
Twelve richly hued flowers and 3 buds on one arching 94cm inflorescence;
	sepals and petals white overlaid almost fully with heavy fuchsia except for a very narrow, but distinct, white picotee,
	lateral sepals dark purple-dotted basally;
	lip dark fuchsia with white picotee on the side lobes, calli lemon yellow spotted with fuchsia;
	column fuchsia, anther cap white; substance average; texture crystalline.
